package com.carloscaldas.algorithms.hackerrank.strings;

import org.junit.Assert;
import org.junit.Test;

public class PalindromeIndexTest {

	@Test
	public void testPalindromes01() {
		Assert.assertEquals(-1, PalindromeIndex.getMismatchIndex("aaa")); // ok
		Assert.assertEquals(-1, PalindromeIndex.getMismatchIndex("aa")); // ok
		Assert.assertEquals(-1, PalindromeIndex.getMismatchIndex("")); // ok
		Assert.assertEquals(-1, PalindromeIndex.getMismatchIndex("a")); // ok
		Assert.assertEquals(-1, PalindromeIndex.getMismatchIndex("aba")); // ok
		Assert.assertEquals(-1, PalindromeIndex.getMismatchIndex("ababa")); // ok
	}

	@Test
	public void testFromFiles() {
		// Input '14
		final String LINE1 = "";
		final String LINE3 = "";
		final String LINE4 = "";
		final String LINE5 = "";

		Assert.assertEquals(16722, PalindromeIndex.getMismatchIndex(LINE1)); // ok
		Assert.assertEquals(10035, PalindromeIndex.getMismatchIndex(LINE3)); // ok
		Assert.assertEquals(57089, PalindromeIndex.getMismatchIndex(LINE4)); // ok
		Assert.assertEquals(46674, PalindromeIndex.getMismatchIndex(LINE5)); // ok

		// Input11
		Assert.assertEquals(44, PalindromeIndex.getMismatchIndex("hgygsvlfcwnswtuhmyaljkqlqjjqlqkjlaymhutwsnwcwflvsgygh")); // ok
	}

	@Test
	public void test01() {
		Assert.assertEquals(5, PalindromeIndex.getMismatchIndex("acddcba")); // ok
		Assert.assertEquals(1, PalindromeIndex.getMismatchIndex("abcddca")); // ok
		Assert.assertEquals(0, PalindromeIndex.getMismatchIndex("baa")); // ok
		Assert.assertEquals(4, PalindromeIndex.getMismatchIndex("aaaab")); // ok
		Assert.assertEquals(3, PalindromeIndex.getMismatchIndex("aaab")); // ok
		Assert.assertEquals(3, PalindromeIndex.getMismatchIndex("bcbc"));
		Assert.assertEquals(1, PalindromeIndex.getMismatchIndex("abcddca")); // ok
		Assert.assertEquals(3, PalindromeIndex.getMismatchIndex("abcdeecba")); // ok
		Assert.assertEquals(1, PalindromeIndex.getMismatchIndex("abaaaa")); // ok
		Assert.assertEquals(0, PalindromeIndex.getMismatchIndex("ab")); // ok
		Assert.assertEquals(2, PalindromeIndex.getMismatchIndex("aab")); // ok
		Assert.assertEquals(0, PalindromeIndex.getMismatchIndex("abb")); // ok
		
		Assert.assertEquals(6, PalindromeIndex.getMismatchIndex("abwawbwa")); // ok
		
	}

}
